import webbrowser
from base64 import b64encode

def create_image():
    # Substitua esta string pelo seu Base64 real (exemplo com SVG)
    base64_data = """
    
    """.strip().replace('\n', '')
    
    # Verifica se  SVG (como fallback)
    if "svg" in base64_data:
        return base64_data
    else:
        # Se for PNG/JPG, adiciona o prefixo correto
        return f"data:image/png;base64,{base64_data}"

def create_puzzle():
    image_data = create_image()
    html = f"""
<!DOCTYPE html>
<html>
<head>
    <title>BRP Developer Puzzle</title>
    <style>
        body {{
            font-family: Arial, sans-serif;
            display: flex;
            flex-direction: column;
            align-items: center;
            background: #f5f5f5;
            padding: 20px;
        }}
        .puzzle-container {{
            width: 400px;
            height: 200px;
            display: grid;
            grid-template-columns: repeat(3, 1fr);
            grid-template-rows: repeat(2, 1fr);
            gap: 5px;
            margin: 20px;
        }}
        .puzzle-piece {{
            width: 100%;
            height: 100%;
            background-size: 600px 300px;
            cursor: move;
            border: 2px solid #002D62;
            transition: transform 0.2s;
            background-repeat: no-repeat;
        }}
        .puzzle-piece:hover {{
            transform: scale(1.03);
            box-shadow: 0 0 10px rgba(0,0,0,0.3);
        }}
        .drop-zone {{
            width: 600px;
            height: 300px;
            border: 3px dashed #002D62;
            margin-top: 20px;
            display: grid;
            grid-template-columns: repeat(3, 1fr);
            grid-template-rows: repeat(2, 1fr);
            gap: 5px;
            background-color: rgba(0, 45, 98, 0.1);
        }}
        .puzzle-slot {{
            width: 100%;
            height: 100%;
            background-size: 400px 200px;
            background-repeat: no-repeat;
        }}
        .feedback {{
            display: none;
            font-size: 24px;
            margin-top: 20px;
            text-align: center;
            padding: 15px;
            border-radius: 5px;
        }}
        .success {{
            color: #002D62;
            background-color: rgba(76, 175, 80, 0.2);
        }}
        .error {{
            color: #E51016;
            background-color: rgba(229, 16, 22, 0.1);
        }}
        #linkedin {{
            color: #E51016;
            text-decoration: none;
            font-weight: bold;
        }}
        #reset-btn {{
            margin-top: 20px;
            padding: 10px 20px;
            background-color: #002D62;
            color: white;
            border: none;
            border-radius: 5px;
            cursor: pointer;
            font-size: 16px;
            transition: background-color 0.3s;
        }}
        #reset-btn:hover {{
            background-color: #E51016;
        }}
    </style>
</head>
<body>
    <h2>Solve your new Python dev's puzzle:<h2>
    <p>Drag the pieces to the area below to form the message</p>
    
    <div class="puzzle-container" id="puzzle-pieces"></div>
    
    <div class="drop-zone" id="drop-zone"></div>
    
    <button id="reset-btn">Restart</button>
    
    <div class="feedback success" id="success-message">
        <p>Congratulations! You solved the puzzle!</p>
        <p>Thanks for your time, and let me know if you enjoyed it!</p>
        <p>Let's connect: <a id="linkedin" href="https://www.linkedin.com/in/victor-p-a-24a997161/" target="_blank">Victor P. Arajo</a></p>
        <p>E-mail(secondary): vpa.cwb.cntkt703@protonmail.com</p>
    </div>
    
    <div class="feedback error" id="error-message">
        <p>Oops! Try again - Restart the game!</p>
    </div>

    <script>
        // Configurao do puzzle
        const pieces = 6;
        const dropZone = document.getElementById('drop-zone');
        const successMessage = document.getElementById('success-message');
        const errorMessage = document.getElementById('error-message');
        const puzzlePiecesContainer = document.getElementById('puzzle-pieces');
        const resetBtn = document.getElementById('reset-btn');
        const imageUrl = "{image_data}";
        
        // Funo para embaralhar array (Fisher-Yates)
        function shuffleArray(array) {{
            for (let i = array.length - 1; i > 0; i--) {{
                const j = Math.floor(Math.random() * (i + 1));
                [array[i], array[j]] = [array[j], array[i]];
            }}
            return array;
        }}

        // Cria peas do puzzle com embaralhamento
        function createPieces() {{
            puzzlePiecesContainer.innerHTML = '';
            
            // Criar array de ndices embaralhados
            let indexes = Array.from({{length: pieces}}, (_, i) => i);
            indexes = shuffleArray(indexes);
            
            // Criar peas na ordem embaralhada
            for (let i = 0; i < pieces; i++) {{
                const pieceIndex = indexes[i];
                const piece = document.createElement('div');
                piece.className = 'puzzle-piece';
                piece.draggable = true;
                piece.dataset.index = pieceIndex;
                
                const row = Math.floor(pieceIndex / 3);
                const col = pieceIndex % 3;
                piece.style.backgroundImage = `url('${{imageUrl}}')`;
                piece.style.backgroundPosition = `-${{col * 200}}px -${{row * 150}}px`;
                
                piece.addEventListener('dragstart', dragStart);
                puzzlePiecesContainer.appendChild(piece);
            }}
        }}

        // Cria slots vazios para o puzzle
        function createSlots() {{
            dropZone.innerHTML = '';
            for (let i = 0; i < pieces; i++) {{
                const slot = document.createElement('div');
                slot.className = 'puzzle-slot';
                slot.dataset.index = i;
                slot.addEventListener('dragover', dragOver);
                slot.addEventListener('drop', drop);
                dropZone.appendChild(slot);
            }}
        }}
        
        // Funo de reset
        function resetPuzzle() {{
            successMessage.style.display = 'none';
            errorMessage.style.display = 'none';
            dropZone.style.border = '3px dashed #002D62';
            createSlots();
            createPieces();
        }}
        
        // Evento do boto reset
        resetBtn.addEventListener('click', resetPuzzle);
        
        // Inicializa o puzzle
        createPieces();
        createSlots();
        
        // Variveis para arrastar peas
        let draggedPiece = null;
        
        function dragStart(e) {{
            draggedPiece = e.target;
            e.dataTransfer.setData('text/plain', e.target.dataset.index);
        }}
        
        function dragOver(e) {{
            e.preventDefault();
        }}
        
        function drop(e) {{
            e.preventDefault();
            if (draggedPiece) {{
                e.target.appendChild(draggedPiece);
                e.target.style.backgroundImage = draggedPiece.style.backgroundImage;
                e.target.style.backgroundPosition = draggedPiece.style.backgroundPosition;
                checkCompletion();
            }}
        }}
        
        // Verifica se o puzzle est completo
        function checkCompletion() {{
            const slots = document.querySelectorAll('#drop-zone > div');
            let complete = true;
            
            // Verifica se todas as peas esto nos slots corretos
            slots.forEach((slot, index) => {{
                if (slot.children.length === 0 || 
                    parseInt(slot.children[0].dataset.index) !== index) {{
                    complete = false;
                }}
            }});
            
            // Verifica se todos os slots esto preenchidos
            const allSlotsFilled = Array.from(slots).every(slot => slot.children.length > 0);
            
            if (complete && allSlotsFilled) {{
                // Puzzle montado corretamente
                successMessage.style.display = 'block';
                errorMessage.style.display = 'none';
                dropZone.style.border = '3px solid #4CAF50';
                triggerConfetti();
            }} else if (allSlotsFilled) {{
                // Todas as peas colocadas mas posio errada
                successMessage.style.display = 'none';
                errorMessage.style.display = 'block';
                dropZone.style.border = '3px dashed #E51016';
            }}
        }}
        
        // Efeito de confete
        function triggerConfetti() {{
            const colors = ['#002D62', '#E51016', '#FFD700'];
            for (let i = 0; i < 100; i++) {{
                setTimeout(() => {{
                    const confetti = document.createElement('div');
                    confetti.style.position = 'fixed';
                    confetti.style.width = '10px';
                    confetti.style.height = '10px';
                    confetti.style.backgroundColor = colors[Math.floor(Math.random() * colors.length)];
                    confetti.style.left = Math.random() * window.innerWidth + 'px';
                    confetti.style.top = '-10px';
                    confetti.style.borderRadius = '50%';
                    confetti.style.zIndex = '1000';
                    document.body.appendChild(confetti);
                    
                    let pos = -10;
                    const fall = setInterval(() => {{
                        pos += 5;
                        confetti.style.top = pos + 'px';
                        if (pos > window.innerHeight) {{
                            clearInterval(fall);
                            confetti.remove();
                        }}
                    }}, 30);
                }}, i * 50);
            }}
        }}
    </script>
</body>
</html>
"""
    return html

# Salva e abre o arquivo
with open("BRP_puzzle.html", "w", encoding='utf-8') as f:
    f.write(create_puzzle())
webbrowser.open("BRP_puzzle.html")